import React from 'react'
import './OptionCell.styles.css'

interface IOptionCell {
	children: any,
	className: string,
	rewardColor?: string
	onClick?: () => void
	answerColor?: string
}

export const OptionCell: React.FC<IOptionCell>=({
													children,
													className,
													onClick,
													rewardColor
												}) => {
	return (
		<div className={'Main-container'} onClick={onClick}>
			<div className={`${className} 'before' ${rewardColor ? '-' + rewardColor : ''}` }></div>
			<div className={`Container ${className ? className : ''}${rewardColor ? '-' + rewardColor : ''}`}>
				{children}
			</div>
			<div className={`${className ? className + '-before' : 'before'}${rewardColor ? '-' + rewardColor : ''}`}></div>
		</div>
	)
}
